import React from 'react';

const UserTableRow = ({ user, onDelete }) => {
  const { id, name, email } = user;

  return (
    <tr>
      <td>{name}</td>
      <td>{email}</td>
      <td>
        <button onClick={() => onDelete(id)}>Delete</button>
      </td>
    </tr>
  );
};

export default UserTableRow;
